import React from "react";
import AnimationRevealPage from "helpers/AnimationRevealPage.js";
import Header from "components/headers/light.js";
import Pricing from "components/hero/TwoColumnWithVideo.js";
import Testimonial from "components/testimonials/ThreeColumnWithProfileImage.js";
import Footer from "components/footers/MiniCenteredFooter";
import FAQ from "components/faqs/SingleCol.js";

export default () => {
  return (
    <AnimationRevealPage>

      <Pricing 
          heading={<>PRENNEZ UNE LONGUEUR <Incline><HighlightedText>D'AVANCE</HighlightedText></Incline></>}
          description="Un système unique qui permet de générer des plans nutritionels adapté à vos objectifs et à vos péférences."
          imageSrc="https://cdn.dribbble.com/users/3320958/screenshots/15955423/media/ec2fe461084339c3a4d14efae1202847.jpeg?compress=1&resize=1000x750&vertical=top"
          imageCss={imageCss}
          imageDecoratorBlob={true}
          primaryButtonText="Essai gratuit"
          watchVideoButtonText="Nos Services"

      />
      {/* <Testimonial
        heading="Our Paying Customers"
      /> */}
      <FAQ />
      <Footer/>
    </AnimationRevealPage>
  );
};
